import React from "react";

class Error extends React.Component {
  render() {
    return (
      <div className="Error-page">
        <h1 id="err">ERRROR !</h1>
        <h3 id="msg"> PATH NOT FOUND</h3>
      </div>
    );
  }
}
export default Error;
